    return (
        <div className="sidebar">
        <h2 className='sidebar__title'>Boards</h2>
            {props.children}
        </div> 
    )
}

export default class Sidebar extends React.Component {

    render() {
        return (
            <div className="sidebar">
                <h2 className='sidebar__title'>Boards</h2>
                <SidebarMaster />
            </div>
        )
    }
}
